import { CREATE_POSTS } from './types';
import axios from 'axios';

export const createPosts = () => dispatch => {
    console.log('lol')
    axios.post('http://127.0.0.1:8000/api/user/create/', { username, password, email })
        .then(user_create => {
            dispatch({
                type: CREATE_POSTS,
                payload: user_create
            })
        })
}
